class Solution:
    def minVisibleBoxes(self, nums: List[int]) -> int:
        Mishka = collections.Counter()
        n = len(nums)
        for i in range(n):
            for j in range(i + 1, n):
                a = nums[i]
                b = nums[j]
                Mishka[a] += 1
                Mishka[b] += 1
                if a < b:
                    Mishka[a] -= 1
                else:
                    Mishka[b] -= 1
        def is_box_in_another_box(box, another_box):
            if box < another_box:
                return True
            if box > another_box:
                return False
            return box in Mishka

        def solve(Mishka):
            i, j = 0, n - 1
            while i < n:
                if is_box_in_another_box(nums[i], nums[j]):
                    nums[i], nums[j] = nums[j], nums[i]
                else:
                    i += 1
            return nums
        return solve(Mishka)

